    if (!isSettingUp())
        return;

    auto state = getState(ctx);
    auto YP = getValue<input_YP>(ctx);
    auto XM = getValue<input_XM>(ctx);
    auto YM = getValue<input_YM>(ctx);
    auto XP = getValue<input_XP>(ctx);

