        button->drawButton();  // draw normal 
        emitValue<output_PRESS>(ctx, 0);
    }

    emitValue<output_XOUT>(ctx, xin);
    emitValue<output_YOUT>(ctx, yin);
    emitValue<output_DONE>(ctx, 1);
}

